@alsrgv - Thanks for providing the repro. The root cause is that there is no special handling of empty tensors in this model, thus when the model couldn't find any detections this kind of error pops up. We are currently working to add native ONNX support to torchvision, which includes faster/mask rcnn. This issue will be fixed and the model zoo model updated to be more robust.
Could you try with a real image, with the recommended preprocessing steps?

@hariharans29 - The model is pretrained on images of shape around (3, 800, 1088), so that is the recommended shape and ratio to use to achieve best performance.
